import axios from 'axios'
export const requestData = (path) => {
    return axios(`http://localhost:5000${path}`, {
        // Parametros
        method: 'GET',
        headers: {
            'Content-Type': 'application/json',
        },
    }).then((data) => {
        console.log(data)
        return(data)
    }).catch((err) => console.log(err))
}
